import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";

const Doctors = () => {
  const doctors = [
    {
      id: 1,
      name: "Dr. John Doe",
      rating: 4.8,
      post: "Cardiologist",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit...",
      image:
        "https://img.freepik.com/free-photo/bearded-doctor-glasses_23-2147896187.jpg",
    },
    {
      id: 1,
      name: "Dr. John Doe",
      rating: 4.8,
      post: "Cardiologist",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit...",
      image:
        "https://img.freepik.com/free-photo/bearded-doctor-glasses_23-2147896187.jpg",
    },
    {
      id: 1,
      name: "Dr. John Doe",
      rating: 4.8,
      post: "Cardiologist",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit...",
      image:
        "https://img.freepik.com/free-photo/bearded-doctor-glasses_23-2147896187.jpg",
    },
    // Add more doctors here
  ];
  return (
    <Container id="doctors">
      <h2>Meet Our Doctors</h2>
      <Row>
        {doctors.map((doctor) => (
          <Col md={4} key={doctor.id}>
            <Card>
              <Card.Img variant="top" src={doctor.image} alt={doctor.name} />
              <Card.Body>
                <Card.Title>{doctor.name}</Card.Title>
                <Card.Subtitle className="mb-2 text-muted">
                  {doctor.post}
                </Card.Subtitle>
                <Card.Text>{doctor.description}</Card.Text>
                <div className="d-flex justify-content-between">
                  <span>Rating: {doctor.rating}</span>
                  <button className="btn btn-primary">Book Appointment</button>
                </div>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};
export default Doctors;
